import React from "react";
import Login_SingUp_image from "../Images/Login_Singup_image.jpg"
import ToggleButton from "../components/custom controls/ToggleButton"
import LabelStyle1 from "../components/custom controls/labels/LabelStyle1";
export default function Login_SingUp(){
    return(
        <div className="flex items-center justify-center h-screen bg-white">
            <div className="grid grid-cols-2 w-[50%] h-[500px] bg-gray-50 rounded-lg shadow-md">
                {/*image section*/}
                <div>
                    <img src={Login_SingUp_image} alt="Univ-Boumerdes-Image" className="w-full h-full object-fill"/>
                </div>
                {/* Login and sing up section */}
                <div className="grid grid-rows-3">
                    {/* Student_adminstation switch and welcom part */}
                    <div>
                        <ToggleButton toggleButtonClassName="justify-center mt-1" leftLabel="Administration" rightLabel="Student"/>
                        <LabelStyle1 labelText="Login" labelClassName="text-3xl"/>
                    </div>
                    {/* Login_singUP form */}
                    <div className="bg-green-300 row-span-2">

                    </div>
                </div>
            </div>
        </div>
    );
}
